import { cache, stopVO, system, physics, stageController, playMusic, stopMusic, playSFX, setSFXVolume, fadeInMusic,  setMusicVolume, fadeOutMusic, fadeInSFX, musicPlayer } from "../App";
import Scene from "../core/Scene";
import { Player } from "../display/Player";
import { PlayerDeath } from "../display/PlayerDeath";
import { EnemyPool } from "../display/EnemyPool";
import { Platform } from "../display/Platform";
import { ToiletPaper } from "../display/ToiletPaper";
import { CrazyCatLady } from "../display/CrazyCatLady";
import { OutHouse } from "../display/OutHouse";
import { DistanceLine } from "../display/DistanceLine";

import VisibilityChange from "../core/VisibilityChange";

class Game extends Scene
{
	constructor()
	{
		super();
	}

	// Build the Game Scene
	build()
	{
		this.halfWidth = system.width / 2;
		this.halfHeight = system.height / 2;
		this.name = 'Game';
		this.backGroundCont = new cjs.Container();
		this.floorCont = new cjs.Container();
		this.debugCont = new cjs.Container();
		this.pauseContainer = new cjs.Container();
		this.extraMode = false;
		this.stopEnemySpawn = false;
		this.inOutHouse = false;
		this.cloudBGArray = [];
		this.cityBGArray = [];
		this.grassBGArray = [];
		this.musicVolume = 0.5;
		this.sfxMuted = false;
		this.floorArray = [];
		this.gamePaused = false;
		this.moveGround = true;
		this.continueMode = false;
		this.gameOver = false;
		this.continueAdPressed = false;
		this.footCounter = 0;
		this.feetTraveled = 0;
		this.tpCounter = 0;
		this.speed = 200;
		this.spawnWaiter = Math.range(300, 600);
		this.platFormWaiter = Math.range(200, 600);
		this.birdWaiter = Math.range (450, 650);
		this.spawnTimer = Math.range(300,600);
		this.birdTimer = Math.range(250, 450);
		this.platFormTimer = Math.range(200,600);

		this.tpWaiter = Math.range(200,600);
		this.tpTimer = Math.range(200,600);

		let shape =  new cjs.Graphics();
		shape.f("#000000").r(0,0,this.halfWidth*2, 200);
		this.groundShape = new cjs.Shape(shape);
		this.groundShape.x = -this.halfWidth;
		this.groundShape.y = this.halfHeight-100;
		let backGround = this.getShape(system.width, system.height,-this.halfWidth, -this.halfHeight);
		backGround.on('mousedown', this.playerJump, this);
		backGround.on('pressup', this.playerStopJump, this);
		this.addChild(backGround, this.backGroundCont, this.groundShape, this.floorCont, this.debugCont);
		this.addBackGrounds();
		this.addFloor();
		this.addPhysics();
		this.addEnemy();
		this.addPlayer();
		this.addPlatform();
		this.addTP();
		this.setupTreeText();
		this.setupUI();
		this.createPauseMenu();
		this.visibility = new VisibilityChange(this.pauseGame.bind(this));
	}

	playerStopJump()
	{

		if(this.outHouse){
			this.outHouse.pressDown = false;
		}
	}

	setupUI()
	{
		this.feetText = new cjs.Text(this.feetTraveled, '130px pixel_maz', '#ffffff').set({ textAlign:'center', textBaseline: 'middle', y: -this.halfHeight+160});
		this.tpUI = new cjs.Sprite(cache.get('gameSS'), 'toilet-paper').set({scaleX:0.8, scaleY:0.8, x:-this.halfWidth + 75, y: -this.halfHeight+163}).center();
		this.tpText = new cjs.Text('x'+this.tpCounter, '120px pixel_maz', '#ffffff').set({ textAlign:'left', textBaseline: 'middle', x: -this.halfWidth + 135, y: -this.halfHeight+160});
		this.pauseBtn = new cjs.Sprite(cache.get('gameSS'), 'pause').set({name:'pause', x:this.halfWidth - 100, y: -this.halfHeight+163}).center();
		let shape =  new cjs.Graphics();
		shape.f("#000000").r(0,0,71,83);
		let hitPause = new cjs.Shape(shape);
		this.pauseBtn.hitArea = hitPause;
		this.pauseBtn.on('mouseover', this.buttonHandler, this);
		this.pauseBtn.on('mouseout', this.buttonHandler, this);
		this.pauseBtn.on('click', this.buttonHandler, this);
		this.distanceLine = new DistanceLine();
		this.distanceLine.y = -system.height*0.5-300;
		this.addChild(this.feetText, this.tpUI, this.tpText, this.pauseBtn, this.distanceLine);
	}

	buttonHandler(e)
	{
		if(e.type === 'mouseover'){
			cjs.Tween.get(e.target).to({scaleX:1.1, scaleY:1.1}, 200, cjs.Ease.quadOut);
			if(e.target.name === 'sound' || e.target.name === 'sound-off'){
				cjs.Tween.get(this.soundBtn.icon).to({scaleX:1.1, scaleY:1.1}, 200, cjs.Ease.quadOut);
			}
		}
		if(e.type === 'mouseout'){
			cjs.Tween.get(e.target).to({scaleX:1, scaleY:1}, 200, cjs.Ease.quadOut);
			if(e.target.name === 'sound' || e.target.name === 'sound-off'){
				cjs.Tween.get(this.soundBtn.icon).to({scaleX:1, scaleY:1}, 200, cjs.Ease.quadOut);
			}
		}

		if(e.type === 'click'){
			playSFX('buttonClick');
			cjs.Tween.get(e.target, {override: true}).to({scaleX:1, scaleY:1}, 200, cjs.Ease.quadOut);
			if(e.target.name === 'pause'){
				this.pauseGame();
			}
			if(e.target.name === 'restart'){
				stageController.gotoScene('Game');
				physics.removeAllEntities();
				physics.kill();
				this.player.kill();
				this.platforms.kill();
				this.enemy.kill();

			}
			if(e.target.name === 'nope'){
				this.callScoreGather();
			}
			if(e.target.name === 'continue'){
				if(!this.continueAdPressed){
					this.callAdContinue();
					this.continueAdBtn.gotoAndPlay('loading');
					this.continueAdPressed = true;
					cjs.Tween.get(this).wait(5000).set({continueAdPressed: false});
				}

			}
			if(e.target.name === 'challenge'){
				let scoreNum = this.scoreTraveledNum;
				let icon = 'data:image/png;base64,';
				// FBInstant.shareAsync({
				// 	intent: 'CHALLENGE',
				// 	image: icon,
				// 	text: 'Can you beat my highscore?',
				// 	data: { myReplayData: scoreNum },
				// 	surface:'MESSENGER',
				//   }).then(function() {
				// 	// continue with the game.

				//   });
			}
			if(e.target.name === 'share'){
				let scoreNum = this.scoreTraveledNum;
				let icon = 'data:image/png;base64,';

				// FBInstant.shareAsync({
				// 	intent: 'SHARE',
				// 	image: icon,
				// 	text: 'I scored this in Bathroom Run can you beat me?',
				// 	data: { myReplayData: scoreNum },
				// 	surface:'FACEBOOK',
				//   }).then(function() {
				// 	// continue with the game.

				//   });
			}
			if(e.target.name === 'sound'){
				if(this.soundBtn.icon.name === 'sound'){
					this.soundBtn.icon.gotoAndPlay('sound-off');
					this.soundBtn.icon.y = -23;
					this.soundBtn.icon.name = 'sound-off';
					this.sfxMuted = true;
					cjs.Tween.get(this.soundBtn.icon).to({scaleX:1, scaleY:1}, 200, cjs.Ease.quadOut);
					setSFXVolume(0);
					setMusicVolume(0);
				} else {
					this.soundBtn.icon.name = 'sound';
					this.soundBtn.icon.gotoAndPlay('sound');
					this.soundBtn.icon.y = -35;
					this.sfxMuted = false;
					cjs.Tween.get(this.soundBtn.icon).to({scaleX:1, scaleY:1}, 200, cjs.Ease.quadOut);
					setSFXVolume(1);
					setMusicVolume(this.musicVolume);
				}

			}
			if(e.target.name === 'back'){
				this.resumeGame();
			}
			if(e.target.name === 'retry'){
				this.mouseEnabled = false;
				stageController.gotoScene('Game');
				physics.removeAllEntities();
				physics.kill();
				this.player.kill();
				this.platforms.kill();
				this.enemy.kill();
			}
			if(e.target.name === 'menu'){
				this.mouseEnabled = false;
				stageController.gotoScene('Title');
				physics.removeAllEntities();
				physics.kill();
				this.player.kill();
				this.platforms.kill();
				this.enemy.kill();
			}


		}
	}

	callScoreGather()
	{
		if(!this.stopEnemySpawn){
			cjs.Tween.get(this.continueAdBtn).to({y:-this.halfHeight-200}, 500, cjs.Ease.backOut);
			cjs.Tween.get(this.nopeBtn).to({y:-this.halfHeight-200}, 500, cjs.Ease.backOut);
			this.distanceLine.sendAway();
		}
		cjs.Tween.get(this.feetText).to({x:0, y:0, scaleX:1.2, scaleY:1.2}, 500);
		cjs.Tween.get(this.tpUI).to({y:0, scaleX:1.2, scaleY:1.2}, 500);
		cjs.Tween.get(this.tpText).to({x: -this.halfWidth + 150, y:0, scaleX:1.2, scaleY:1.2}, 500).wait(100).set({text:'x0'});
		let tpScore = this.tpCounter * 100;
		let tpScoreText = new cjs.Text('+'+tpScore, '120px pixel_maz', '#ffffff').set({ textAlign:'center', textBaseline: 'middle', x: this.tpText.x, y: 0, alpha:0});
		if(this.tpCounter>0){
			cjs.Tween.get(tpScoreText).wait(600).call(this.powerupSound, null, this).to({scaleX:1.2, scaleY:1.2, alpha:1, y: -30}, 250, cjs.Ease.quadOut).to({x:0, y:0}, 250, cjs.Ease.quadOut).call(this.addToFeetText, [tpScore], this).to({alpha:0}, 200);
		} else {
			this.setupAward(tpScore);
		}

		this.addChild(tpScoreText);

	}

	addToLeaderBoard(score)
	{
		// FBInstant
  		// .getLeaderboardAsync('how_long_you_held_it')
  		// .then(leaderboard => {

    	// return leaderboard.setScoreAsync(score);
  		// })
  		// .then(() => console.log('Score saved'))
  		// .catch(error => console.error(error));
	}

	powerupSound()
	{
		playSFX('powerup');
	}

	coinSound()
	{
		playSFX('coin');
	}

	saveHighScore(score)
	{
		let heldItHighScore = localStorage.getItem('heldItHighScore');
		let hsNum = 0;
		if(heldItHighScore === null){
			heldItHighScore = 0;
		} else {
			hsNum = JSON.parse(heldItHighScore);
		}

		if(score > hsNum){
			this.addToLeaderBoard(score);
			this.newScore = new cjs.Text('New High Score!', '120px pixel_maz', '#ff0000').set({ textAlign:'center', textBaseline: 'middle', x: 0, y: -this.halfHeight-100});
			cjs.Tween.get(this.newScore).to({y:80}, 250, cjs.Ease.backOut).call(this.bounceHighScore, null, this);

			this.addChild(this.newScore);
			localStorage.setItem('heldItHighScore', JSON.stringify(score));
		}
	}

	bounceHighScore()
	{
		cjs.Tween.get(this.newScore,{loop:true}).to({scaleX:1.2, scaleY:1.2}, 250, cjs.Ease.bouncInOut).to({scaleX:1, scaleY:1}, 250, cjs.Ease.bouncInOut);
	}

	setupAward(num)
	{
		this.scoreTraveledNum = this.feetTraveled + num;
		this.saveHighScore(this.feetTraveled + num);
		this.award = this.getMedal(num);
		this.addChild(this.award);
		if(this.award.name === 'gold'){
			cjs.Tween.get(this.award).wait(1200).call(this.playApplause, null, this).to({y:-350}, 1000, cjs.Ease.quadOut).call(this.callEndGameMenu, null, this);
		} else {
			cjs.Tween.get(this.award).wait(1200).to({y:-350}, 1000, cjs.Ease.quadOut).call(this.callEndGameMenu, null, this);
		}

	}

	playApplause()
	{
		playSFX('applause');
	}

	buttonSetup(btn)
	{
		btn.on('mouseover', this.buttonHandler, this);
		btn.on('mouseout', this.buttonHandler, this);
		btn.on('click', this.buttonHandler, this);
	}

	addToFeetText(num)
	{
		this.feetText.text = this.feetTraveled + num;
		this.coinSound();
		this.setupAward(num);
	}

	callEndGameMenu()
	{
		cjs.Tween.get(this.tpUI).to({x:-this.halfWidth-300}, 500, cjs.Ease.backIn);
		cjs.Tween.get(this.tpText).to({x:-this.halfWidth-300}, 500, cjs.Ease.backIn);
		cjs.Tween.get(this.feetText).to({x:-this.halfWidth-300}, 500, cjs.Ease.backIn);
		if(this.newScore){
			cjs.Tween.get(this.newScore, {override:true}).to({x:-this.halfWidth-500}, 500, cjs.Ease.backIn);
		}
		this.shareBtn = new cjs.Sprite(cache.get('gameSS'), 'share').set({name: 'share', x:150, y:350}).center();
		this.challengeBtn = new cjs.Sprite(cache.get('gameSS'), 'challenge').set({name: 'challenge', x:-150, y: 350}).center();
		if(this.feetTraveled>1000){
			this.retryBtn = new cjs.Sprite(cache.get('gameSS'), 'retry-2').set({name: 'retry', x:0, y: -110}).center();
		} else {
			this.retryBtn = new cjs.Sprite(cache.get('gameSS'), 'retry').set({name: 'retry', x:0, y: -110}).center();
		}
		this.menuBtn = new cjs.Sprite(cache.get('gameSS'), 'menu').set({name: 'menu', x:0, y: 110}).center();
		this.buttonSetup(this.shareBtn);
		this.buttonSetup(this.challengeBtn);
		this.buttonSetup(this.retryBtn);
		this.buttonSetup(this.menuBtn);
		this.addChild(this.shareBtn, this.challengeBtn, this.retryBtn, this.menuBtn, this.award);
		this.challengeBtn.visible =  false;
		this.shareBtn.visible = false;
	}

	getMedal(num)
	{
		if(this.feetTraveled + num <= 500){
			return new cjs.Sprite(cache.get('gameSS'), 'bronze-award').set({name: 'bronze', x:0, y: -this.halfHeight-300}).center();
		}else if(this.feetTraveled + num > 500 && this.feetTraveled < 1000){
			return new cjs.Sprite(cache.get('gameSS'), 'silver-award').set({name: 'silver', x:0, y: -this.halfHeight-300}).center();
		} else if(this.feetTraveled + num >= 1000){
			return new cjs.Sprite(cache.get('gameSS'), 'gold-award').set({name: 'gold', x:0, y: -this.halfHeight-300}).center();
		}

	}


	createPauseMenu()
	{
		let shapePause =  new cjs.Graphics();
		shapePause.f("#000").r(0,0,this.halfWidth*2, this.halfHeight*2);
		let pauseBG = new cjs.Shape(shapePause);
		pauseBG.x = -this.halfWidth;
		pauseBG.y = -this.halfHeight;
		pauseBG.alpha = 0.5;
		this.restartBtn = new cjs.Sprite(cache.get('gameSS'), 'resart').set({name: 'restart', x:0, y:-250}).center();
		this.soundBtn = new cjs.Sprite(cache.get('gameSS'), 'soundBtn').set({name: 'sound', x:0, y: 0}).center();
		if(musicPlayer.volume === 0){
			this.soundIcon = new cjs.Sprite(cache.get('gameSS'), 'sound').set({name: 'sound-off', x:100, y: -23}).center();
			this.soundIcon.gotoAndPlay('sound-off');
			this.soundBtn.icon = this.soundIcon;
		} else {
			this.soundIcon = new cjs.Sprite(cache.get('gameSS'), 'sound').set({name: 'sound', x:100, y: -35}).center();
			this.soundBtn.icon = this.soundIcon;
		}

		this.backBtn = new cjs.Sprite(cache.get('gameSS'), 'back').set({name: 'back', x:0, y: 250}).center();
		this.pauseContainer.addChild(pauseBG, this.restartBtn, this.soundBtn, this.soundIcon, this.backBtn);
		this.pauseContainer.visible = false;
		this.addChild(this.pauseContainer);

		this.restartBtn.on('mouseover', this.buttonHandler, this);
		this.restartBtn.on('mouseout', this.buttonHandler, this);
		this.restartBtn.on('click', this.buttonHandler, this);

		this.soundBtn.on('mouseover', this.buttonHandler, this);
		this.soundBtn.on('mouseout', this.buttonHandler, this);
		this.soundBtn.on('click', this.buttonHandler, this);

		this.backBtn.on('mouseover', this.buttonHandler, this);
		this.backBtn.on('mouseout', this.buttonHandler, this);
		this.backBtn.on('click', this.buttonHandler, this);
	}

	pauseGame()
	{
		// if(this.player.playerDied){return;}
		if(this.continueMode || this.player.playerDied || this.gameOver){return;}
		this.gamePaused = true;
		this.tp.tweenGroup.paused = true;
		this.pauseContainer.visible = true;
		if(this.crazyCatLady){
			this.crazyCatLady.tweenGroup.paused = true;
		}
		setMusicVolume(0);
	}

	resumeGame()
	{
		this.gamePaused = false;
		this.tp.tweenGroup.paused = false;
		this.pauseContainer.visible = false;
		if(this.crazyCatLady){
			this.crazyCatLady.tweenGroup.paused = false;
		}
		if(!this.sfxMuted){
			setMusicVolume(this.musicVolume);
		}
	}

	addTP()
	{
		this.tp = new ToiletPaper();
		this.addChild(this.tp);
	}

	addToTPScore()
	{
		this.tpCounter++;
		this.tpText.text = 'x'+this.tpCounter;
	}


	setupTreeText()
	{
		this.treeText = new cjs.Text('WARNING INCOMING TREE', '90px pixel_maz', '#FF0000').set({visible: false, textAlign:'center'});
		this.treeText.y = -this.halfHeight+200;
		this.addChild(this.treeText);
	}

	flashTreeWarning()
	{
		cjs.Tween.get(this.treeText)
		.wait(500)
		.set({visible:true})
		.wait(500)
		.set({visible:false})
		.wait(500)
		.set({visible:true})
		.wait(500)
		.set({visible:false})
		.wait(500)
		.set({visible:true})
		.wait(500)
		.set({visible:false})
		.wait(500);
	}

	stopTreeWarning()
	{
		cjs.Tween.get(this.treeText, {override:true})
		.set({visible:false});
	}

	playerJump()
	{
		if(this.player.playerDied){return;}
		if(this.outHouse && !this.outHouse.died){
			this.outHouse.pressDown = true;
			this.triggerOutHouseSound();
			return;
		}
		if(!this.outHouse){
			this.player.jump();
		}
	}

	triggerOutHouseSound()
	{
		if(!this.outHouse.pressDown){return;}
		let fartSounds = ['fart5', 'shortfart', 'shortfart1'];
		fartSounds.shuffle();
		this.playFart(fartSounds[0]);
	}
	async playFart(sound)
	{
		await new Promise(resolve =>
		{
			let sfx = playSFX(sound);
			sfx.on('complete', resolve);
		});
		await new Promise(resolve =>
		{
			this.triggerOutHouseSound();
		});
	}

	addEnemy()
	{
		this.enemy = new EnemyPool();
		this.addChild(this.enemy);
	}

	addPlatform()
	{
		this.platforms = new Platform();
		this.addChild(this.platforms);
	}

	addPhysics()
	{
		physics.createGround(0, this.halfHeight-60, this.halfWidth*3, 100);
		physics.createWall(-100,0, 50, 2000);
		// physics.drawDebug(this.debugCont, system.stage);
	}
	addPlayer()
	{
		this.player = new Player();
		this.player.createBox(physics.world, -300, this.halfHeight-200);
		this.addChild(this.player);
		let indexNum = this.getChildIndex(this.player);
	}

	addCrazyCatLady()
	{
		this.crazyCatLady = new CrazyCatLady();
		this.addChild(this.crazyCatLady, this.pauseContainer);
	}

	addOutHouse()
	{
		if(this.moveGround){
			this.player.outhouseOn = true;
			this.outHouse = new OutHouse();
			this.addChildAt(this.outHouse, 4);
		}
	}

	changeOutHouseIndex()
	{
		this.inOutHouse = true;
		this.player.visible = false;
		this.addChildAt(this.outHouse,5);
	}


	playerDie()
	{

		stopMusic();
		let dieFartArray = [
		'fart1',
		'fart2',
		'fart3',
		'fart4'
		];
		dieFartArray.shuffle();
		playSFX(dieFartArray[0]);
		if(this.crazyCatLady){
			this.crazyCatLady.gameOver();
		}
		this.moveGround = false;
		this.player.kill();
		this.enemy.checkDeadPool();
		physics.destroyWall();
		this.removeChild(this.treeText);
		this.treeText = null;
		if(this.outHouse){
			this.removeChild(this.outHouse);
		}
		cjs.Tween.get(this).wait(6500).call(this.callEndGame, null, this);

	}

	callEndGame()
	{
		if(this.stopEnemySpawn){
			this.callScoreGather();
			return;
		}
		this.gameOver = true;
		this.continueAdBtn = new cjs.Sprite(cache.get('gameSS'), 'continue-ad-btn').center();
		this.continueAdBtn.set({y:-this.halfHeight-200, name:'continue'});
		this.nopeBtn = new cjs.Sprite(cache.get('gameSS'), 'nope').center();
		this.nopeBtn.set({y:-this.halfHeight-200, name:'nope'});
		this.continueAdBtn.on('mouseover', this.buttonHandler, this);
		this.nopeBtn.on('mouseover', this.buttonHandler, this);
		this.continueAdBtn.on('mouseout', this.buttonHandler, this);
		this.nopeBtn.on('mouseout', this.buttonHandler, this);
		this.continueAdBtn.on('click', this.buttonHandler, this);
		this.nopeBtn.on('click', this.buttonHandler, this);
		cjs.Tween.get(this.distanceLine).to({y:0}, 500, cjs.Ease.backOut).wait(250).call(this.distanceLine.adjustPointer, null, this.distanceLine);
		cjs.Tween.get(this.continueAdBtn).to({y:-38}, 500, cjs.Ease.backOut);
		cjs.Tween.get(this.nopeBtn).to({y:200}, 500, cjs.Ease.backOut);
		cjs.Tween.get(this.pauseBtn).to({x:500}, 500, cjs.Ease.backIn);
		this.addChild(this.continueAdBtn, this.nopeBtn);
	}

	callAdContinue()
	{
		var ad = null;
		// FBInstant.getRewardedVideoAsync(
		// 	'419469832004620_419478335337103',
		// ).then(function (rewardedVideo)
		// {
		// 	ad = rewardedVideo;
		// 	return ad.loadAsync();
		// }).then(function ()
		// {
		// 	// Ad loaded
		// 	return ad.showAsync();
		// }).then(function ()
		// {
		// 	setTimeout(function(){ window.app.stageController.current.continueGame(); }, 500);
		// 	// Ad watched
		// });
		this.continueGame();

	}

	setContinueBtnBack()
	{
		this.continueAdBtn.gotoAndPlay('continue-ad-btn');
		this.continueAdPressed = false;
	}

	continueGame()
	{

		this.distanceLine.sendAway();
		if(this.continueMode){return;}
		this.gameOver = false;
		cjs.Tween.get(this.continueAdBtn).to({y:-this.halfHeight-200}, 500, cjs.Ease.backOut).call(this.setContinueBtnBack, null, this);
		cjs.Tween.get(this.nopeBtn).to({y:-this.halfHeight-200}, 500, cjs.Ease.backOut);
		cjs.Tween.get(this.pauseBtn).to({x:this.halfWidth - 100}, 500, cjs.Ease.backIn);
		physics.removeAllEntities();
		physics.kill();
		this.player.kill();
		this.removeChild(this.player);
		this.continueMode = true;
		this.moveGround = true;
	}

	setupContinue()
	{
		if(!this.enemy){return;}
		// this.moveGround = false;
		this.enemy.kill();
		this.setupTreeText();
		physics.createGround(0, this.halfHeight-60, this.halfWidth*3, 100);
		physics.createWall(-100,0, 50, 1664);
		this.removeChild(this.player);
		this.removeChild(this.enemy);
		this.enemy = null;

		this.player = new Player();
		this.player.createBox(physics.world, -400, this.halfHeight-200);
		this.addChildAt(this.player, 6);
		cjs.Tween.get(this).wait(1000).call(this.setupEnemyContinue, null, this);

		playMusic('bathroomrun');
		setMusicVolume(this.musicVolume);
	}

	setupEnemyContinue()
	{
		this.enemy = new EnemyPool();
		this.addChildAt(this.enemy, 5);
		this.enemy.speed = this.enemy.speed * 2;
		this.continueMode = false;
	}


	addBackGrounds()
	{
		let grassX = -this.halfWidth;
		let cityX = -this.halfWidth;
		let cloudX = -this.halfWidth;
		for (let i = 0, l = 2; i < l; i++) {
			let cloudBg = new cjs.Sprite(cache.get('gameSS'), 'cloud-background').set({ x: cloudX, y: this.halfHeight-360, regY: 120.5 });
			let bounds = cloudBg.getBounds();
			cloudX += bounds.width;
			cloudBg.width = bounds.width;
			this.backGroundCont.addChild(cloudBg);
			this.cloudBGArray.push(cloudBg);
		}
		for (let i = 0, l = 4; i < l; i++) {
			let num = i + 1;
			let city = new cjs.Sprite(cache.get('citySS'), 'city-background_0' + num).set({ x: cityX, y: this.halfHeight-845 });
			let cityBounds = city.getBounds();
			cityX += cityBounds.width;
			city.width = cityBounds.width;
			this.backGroundCont.addChild(city);
			this.cityBGArray.push(city);

		}

		for (let i = 0, l = 4; i < l; i++) {
			let num = i + 1;
			if(num > 2){
				num -= 2;
			}
			let grass = new cjs.Sprite(cache.get('citySS'), 'grass-bg_0' + num).set({ x: grassX-2, y: this.halfHeight-363 });
			let grassBounds = grass.getBounds();
			grassX += grassBounds.width;
			grass.width = grassBounds.width;
			this.backGroundCont.addChild(grass);
			this.grassBGArray.push(grass);

		}
	}

	addFloor()
	{

		let floorX = -this.halfWidth;
		for (var i = 0, l = 4; i < l; i++) {
			 var floor = new cjs.Sprite(cache.get('gameSS'), 'floor-small').set({ x: floorX, y: this.halfHeight-112 });
			 floorX += 385;
			 this.floorCont.addChild(floor);
			 this.floorArray.push(floor);
		}

	}

	getShape(w,h,xPos, yPos)
	{
		let sg = new cjs.Graphics();
		sg.f("#83a5db").r(0, 0, w, h);
		let ss = new cjs.Shape(sg);
		ss.x = xPos;
		ss.y = yPos;
		return ss;
	}

	start()
	{
		this.enemy.speed = this.enemy.speed * 2;
		this.platforms.speed = this.platforms.speed * 2;
		this.speed = this.speed * 2;
		playMusic('bathroomrun');
		if(musicPlayer.volume !== 0){
			setMusicVolume(this.musicVolume);
		}
	}

	triggerExtraLevel()
	{
		if(this.jumpWarning){return;}
		cjs.Tween.get(this.treeText, {override: true}).set({visible:false});
		this.stopEnemySpawn = true;
		let extraLevelArray = ['cat', 'platform', 'outhouse'];
		if(!global.extraLevel){
			extraLevelArray.shuffle();
			global.extraLevel = extraLevelArray[0];
		} else{
			if(global.extraLevel === 'cat'){
				global.extraLevel = 'platform';
			}else if(global.extraLevel === 'platform'){
				global.extraLevel = 'outhouse';
			} else if(global.extraLevel === 'outhouse'){
				global.extraLevel = 'cat';
			}
		}
		switch(global.extraLevel){
			case 'cat':
				this.callCatLady();
			break;
			case 'platform':
					this.callJumpLevel();
			break;
			case 'outhouse':
				this.callOutHouse();
			break;
		}

	}

	callOutHouse()
	{
		this.stopEnemySpawn = true;
		this.jumpWarning = new cjs.Text('GET IN THE OUTHOUSE!', '90px pixel_maz', '#FF0000').set({ textAlign:'center'});
		this.jumpWarning.y = -this.halfHeight+200;
		this.addChild(this.jumpWarning);
		cjs.Tween.get(this).wait(3000).call(this.addOutHouse, null, this);
	}

	callJumpLevel()
	{
		this.jumpWarning = new cjs.Text('GET READY TO JUMP!', '90px pixel_maz', '#FF0000').set({ textAlign:'center'});
		this.jumpWarning.y = -this.halfHeight+200;
		this.addChild(this.jumpWarning);
		cjs.Tween.get(this).wait(3000).call(this.extraLevelCall, null, this);
	}

	callCatLady()
	{
		this.jumpWarning = new cjs.Text('DODGE THE CATS!', '90px pixel_maz', '#FF0000').set({ textAlign:'center'});
		this.jumpWarning.y = -this.halfHeight+200;
		this.addChild(this.jumpWarning);
		cjs.Tween.get(this).wait(3000).call(this.addCrazyCatLady, null, this);
	}

	extraLevelCall()
	{
		this.jumpWarning.visible = false;
		this.extraMode = true;
		this.eMPlatformTimer = 120;
		cjs.Tween.get(this.backGroundCont).to({x:-500, y:this.halfHeight+600}, 10000);
		cjs.Tween.get(this.floorCont).to({x:-500, y:this.halfHeight+600}, 10000);
		cjs.Tween.get(this.groundShape).to({x:-500, y:this.halfHeight+600}, 8000);
	}

	blastOffLevelCall()
	{
		this.jumpWarning.visible = false;
		this.extraMode = true;
		cjs.Tween.get(this.backGroundCont).to({x:-500, y:this.halfHeight+600}, 1500).call(this.outHouse.startGame, null, this.outHouse);
		cjs.Tween.get(this.floorCont).to({x:-500, y:this.halfHeight+600}, 1500);
		cjs.Tween.get(this.groundShape).to({x:-500, y:this.halfHeight+600}, 500);
		this.platforms.moveUp();
		this.tp.moveUp();
		this.enemy.moveUp();

	}

	outHouseTutorial()
	{
		physics.destroyWall();
		physics.destroyGround();
		physics.createGround(0, -512, this.halfWidth*3, 100);
		physics.createWall(-100,0, 50, 2000);
		physics.createWall2(-260,0, 50, 2000);
		this.player.kill();
		this.jumpWarning.text = 'PRESS DOWN TO GO UP';
		this.jumpWarning.visible = true;
		this.tutorialHand = new cjs.Sprite(cache.get('gameSS'), 'hand').set({x: 0, y: 0, alpha:0}).center();
		this.addChild(this.tutorialHand);
		cjs.Tween.get(this.tutorialHand)
		.to({alpha:1}, 250)
		.wait(2000)
		.to({scaleX:0.8, scaleY:0.8}, 250)
		.wait(1000)
		.call(this.pressUpOutHouse, null, this);
	}

	pressUpOutHouse()
	{
		this.jumpWarning.text = 'RELEASE TO GO DOWN';
		cjs.Tween.get(this.tutorialHand)
		.to({scaleX:1, scaleY:1}, 250)
		.wait(3000)
		.to({alpha:0}, 250)
		.call(this.setJumpTextInvisible, null, this);
	}

	setJumpTextInvisible()
	{
		this.jumpWarning.text = 'GO!';
		cjs.Tween.get(this.jumpWarning).wait(2000).set({visible: false});
	}

	outHouseFeetCounter()
	{
		this.footCounter++;
			if(this.footCounter>10){
				this.footCounter = 0;
				this.feetTraveled++;
				if(this.feetTraveled > 1500 && !this.outHouse.outHouseObstacles.hardMode){
					this.outHouse.triggerHardMode();
				}
				this.feetText.text = this.feetTraveled;
		}
	}
	_tick(e)
	{
		if(this.gamePaused){return;}
		let tick = e.delta / 1000;
		physics.update(tick);
		if(this.outHouse){
			this.outHouse.update(e.delta / 1000, this.speed);

		}

		if (this.moveGround && !this.inOutHouse) {
			this.footCounter++;
			if(this.footCounter>10){
				this.footCounter = 0;
				this.feetTraveled++;
				if(this.feetTraveled > 1000 && !this.extraMode){
					this.triggerExtraLevel();
				}
				this.feetText.text = this.feetTraveled;
			}

			for (let i = 0, l = this.grassBGArray.length; i < l; i++) {
				let grass = this.grassBGArray[i];
				grass.x -= 0.8 * this.speed * tick;
				if (grass.x < -this.halfWidth - grass.width) {
					grass.x += grass.width * 4 - 2;
				}
			}
			for (let i = 0, l = this.cloudBGArray.length; i < l; i++) {
				let cloud = this.cloudBGArray[i];
				cloud.x -= 0.2 * this.speed * tick;
				if (cloud.x < -this.halfWidth - cloud.width) {
					cloud.x += cloud.width * 2 - 2;
				}
			}
			for (let i = 0, l = this.cityBGArray.length; i < l; i++) {
				let city = this.cityBGArray[i];
				city.x -= 0.6 * this.speed * tick;
				if (city.x < -this.halfWidth - city.width) {
					city.x += city.width * 4 - 5;
				}
			}
			for (let i = 0, l = this.floorArray.length; i < l; i++) {
				let floor = this.floorArray[i];
				floor.x -= this.speed * tick;
				if (floor.x < -this.halfWidth - 385) {
					floor.x += 385 * 4 - 5;
				}
			}
		if(this.enemy){
			this.spawnTimer++;
			if(this.spawnTimer>this.spawnWaiter && !this.stopEnemySpawn){
				this.enemy.spawn();
				this.spawnTimer = 0;
				this.spawnWaiter = Math.range(150, 300);

			}
			this.platFormTimer++;
			if(!this.extraMode){
				if(this.platFormTimer > this.platFormWaiter){
					this.platforms.spawn();
					this.platFormTimer = 0;
					this.platFormWaiter = Math.range(300, 600);

				}
			} else {
				if(this.platFormTimer > this.eMPlatformTimer && !this.inOutHouse){
					this.platforms.spawn();
					this.platFormTimer = 0;
					this.platFormWaiter = Math.range(300, 600);
				}
				let pos = physics.ground.GetPosition();
				let groundSpeed = this.speed * 0.0075;
				if(pos.y<50){
					physics.ground.SetPosition(new b2.b2Vec2(pos.x, pos.y + groundSpeed * tick));
				}
			}
			this.birdTimer++;
			if(this.birdTimer > this.birdWaiter && !this.inOutHouse){
				this.enemy.spawnBird();
				this.birdTimer = 0;
				if(this.extraMode){
					this.birdWaiter = Math.range (150, 250);
				} else {
					this.birdWaiter = Math.range (250, 450);
				}

			}
			this.tpTimer++;
			if(this.tpTimer > this.tpWaiter && !this.inOutHouse){
				this.tp.callToiletPaper();
				this.tpTimer = 0;
				if(this.extraMode){
					this.tpWaiter = Math.range(150, 300);
				} else {
					this.tpWaiter = Math.range(300, 600);
				}

			}

			this.enemy.update(tick);
			if(this.crazyCatLady){
				this.crazyCatLady.update(e.delta / 1000, this.speed);
			}
		}
		this.platforms.update(tick);
		this.tp.update(tick, this.speed);
	}
		 this.player.update();

		super._tick(e);
	}

	end()
	{

	}
}

export default Game;
